import { useNavigate } from "react-router-dom";

function HomeLink() {
  let navigate = useNavigate();

  function handleClick() {
    navigate("/home");
  }

  return (
    <button type="button" onClick={handleClick} className='link'>
      Home
    </button>
  );
}

export default HomeLink;
